import Home from "@/views/Home";
import webAboutIndex from '@/views/webAbout/webAboutIndex'   //关于我们链接的组件

const routes = [{
        path: '/',
        redirect: Home,
    },
    {
        path: '/Home',
        name: 'Home',
        component: Home
    },
    {
        path:'/webAboutIndex',
        name:'webAboutIndex',
        component:webAboutIndex
    }
]



export default routes
